#include <bits/stdc++.h>
using namespace std;
#define sz(x) (int)x.size()
#define all(x) (x).begin(), (x).end()
#define pb emplace_back
#define fi first
#define se second
typedef long long ll;
typedef long double ld;
typedef pair<int, int> pii;
typedef pair<int, ll> pil;
typedef pair<ll, int> pli;
typedef pair<ll, ll> pll;
typedef pair<pii, int> piipi;
typedef pair<int, pii> pipii;
typedef pair<pii, pii> piipii;
typedef pair<ll, pii> plpii;
typedef pair<ld, ld> pdd;
typedef pair<ld, int> pdi;
typedef pair<ld, ll> pdl;
typedef pair<int, ld> pid;
typedef pair<ll, ld> pld;
const int mod = 1e9 + 7;
const int hf = 999983;
const int N = 1e6;
vector<pii> v;
int p[1005];
char s[1005][1005][105];
vector<int> g[26], g2[26];
int deg[26];
bool vis[26];
stack<int> st;
void dfs1(int u){
    vis[u] = 1;
    for(int i=0;i<sz(g[u]);i++){
        int v = g[u][i];
        if(vis[v]) continue;
        dfs1(v);
    }
    st.push(u);
}
int sz = 0;
void dfs2(int u){
    sz++;
    vis[u] = 1;
    for(int i=0;i<sz(g2[u]);i++){
        int v = g2[u][i];
        if(vis[v]) continue;
        dfs2(v);
    }
}

bool vis2[26];
int main(){
    int n, k;
    scanf("%d%d", &n, &k);
    for(int i=1;i<=n;i++){
        scanf("%d", &p[i]);
        v.pb(make_pair(p[i], i));
        for(int j=1;j<=k;j++){
            scanf("%s", s[i][j]+1);
            for(int l=1;l<=strlen(s[i][j]+1);l++){
                vis2[s[i][j][l]-'a'] = 1;
            }
        }
    }
    vector<int> ch;
    for(int i=0;i<26;i++){
        if(vis2[i]) ch.pb(i);
    }

    bool ok = 1;
    sort(all(v));
    for(int i=0;i<sz(v);i++){
        int idx = v[i].second;
        for(int j=2;j<=k;j++){
            int l1 = strlen(s[idx][j-1]+1);
            int l2 = strlen(s[idx][j]+1);

            bool found = 0;
            for(int l=1;l<=min(l1, l2);l++){
                if(s[idx][j-1][l] == s[idx][j][l]) continue;
                int c1 = s[idx][j-1][l]-'a';
                int c2 = s[idx][j][l]-'a';
                g[c1].pb(c2);
                g2[c2].pb(c1);
                deg[c2]++;
                found = 1;
                break;
            }

            if(!found){
                if(l1 > l2){
                    ok = 0;
                    break;
                }
            }
        }

        if(i != 0){
            int idx1 = v[i-1].second;
            int idx2 = v[i].second;
            int l1 = strlen(s[idx1][k]+1);
            int l2 = strlen(s[idx2][1]+1);

            bool found = 0;
            for(int l=1;l<=min(l1, l2);l++){
                if(s[idx1][k][l] == s[idx2][1][l]) continue;
                int c1 = s[idx1][k][l]-'a';
                int c2 = s[idx2][1][l]-'a';
                g[c1].pb(c2);
                g2[c2].pb(c1);
                deg[c2]++;
                found = 1;
                break;
            }

            if(!found){
                if(l1 > l2){
                    ok = 0;
                    break;
                }
            }
        }
        if(!ok) break;
    }

    if(!ok) printf("IMPOSSIBLE\n");
    else{
        memset(vis, 0, sizeof(vis));
        for(int i=0;i<sz(ch);i++){
            int u = ch[i];
            if(vis[u]) continue;
            dfs1(u);
        }

        memset(vis, 0, sizeof(vis));
        while(!st.empty()){
            int u = st.top();
            st.pop();
            if(vis[u]) continue;

            sz = 0;
            dfs2(u);
            if(sz > 1){
                printf("IMPOSSIBLE\n");
                return 0;
            }
        }

        queue<int> q;
        for(int i=0;i<sz(ch);i++){
            int u = ch[i];
            if(deg[u] == 0) q.push(u);
        }
        while(!q.empty()){
            int u = q.front();
            q.pop();
            printf("%c", u+'a');
            for(int i=0;i<sz(g[u]);i++){
                int v = g[u][i];
                deg[v]--;
                if(deg[v] == 0) q.push(v);
            }
        }
    }
}
